<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">
<html>
	<head>
		<title>gowebgo - Test Results</title>
		<meta charset="utf-8">
		<link rel="stylesheet" type="text/css" href="./css/history.css" />
		<script type="text/javascript" src="./js/jquery.min.js"></script>
	</head>
	<body>
		<a href="https://github.com/hermione521/gowebgo">
			<img style="position: absolute; top: 0; right: 0; border: 0; z-index: 70;" src="https://camo.githubusercontent.com/52760788cde945287fbb584134c4cbc2bc36f904/68747470733a2f2f73332e616d617a6f6e6177732e636f6d2f6769746875622f726962626f6e732f666f726b6d655f72696768745f77686974655f6666666666662e706e67" alt="Fork me on GitHub" data-canonical-src="https://s3.amazonaws.com/github/ribbons/forkme_right_white_ffffff.png">
		</a>
		
		<div id="banner">
			<img id="logo" src="./image/logo.png"> <span class="logo">GOWEBGO</span>
			<div class="tags">
				<p class="alignLeft">{{.TestUrl}}</p>
				<p class="alignRight">
					<a id="BackendTag" class="tag">BACKEND</a> | 
					<a id="StartRenderTag" class="tag">START RENDER</a> |
					<a id="DomDeltaTag" class="tag">DOM</a> | 
					<a id="FullyLoadedTag" class="tag">FULLY LOADED</a> | 
					<a id="SpeedIndexTag" class="tag">SPEEDINDEX</a>
				</p>
				<div style="clear: both;"></div>
			</div>
		</div>

		<div id="StartRender" class="highchart"></div>

		<div id="DomDelta" class="highchart"></div>

		<div id="FullyLoaded" class="highchart"></div>

		<div id="SpeedIndex" class="highchart"></div>
		
		<div id="Backend" class="highchart"></div>

		<div class="compare">
			<img id="compare" src="" title="latest browser comparation">
		</div>

		<div class="more">
			<a id="more" href="">More history<br/>results...</a>
		</div>

		<script type="text/javascript" src="./js/highcharts.js"></script>
		<script type="text/javascript" src="./js/dark_unica.js"></script>
		<script type="text/javascript">
			var originData = {{.Data}};
			var wptUrl = {{.WPTUrl}};
		</script>
		<script type="text/javascript" src="./js/history.js"></script>
	</body>
</html>
